    [],nt"revision_timestamp": "2016-05-25T00:19:37.679179",nt"name": "fatality-analysis-reporting-system-fars-online-query-tool-f4fc8",nt"isopen":
    true,nt"url": null,nt"notes": "The program collects data for analysis of
    traffic safety crashes to identify problems, and evaluate countermeasures leading
    to reducing injuries and property damage resulting from motor vehicle crashes. The
    FARS dataset contains descriptions, in standard format, of each fatal crash reported.
     To qualify for inclusion, a crash must involve a motor vehicle traveling a traffic-way
    customarily open to the public and resulting in the death of a person (occupant
    of a vehicle or a non-motorist) within 30 days of the crash.  Each crash has more
    than 100 coded data elements that characterize the crash, the vehicles, and the
    people involved.  The specific data elements may be changed slightly each year to
    conform to the changing user needs, vehicle characteristics and highway safety emphasis
    areas.  The type of information that FARS, a major application, processes is therefore
    motor vehicle crash data.",nt"license_title": "U.S. Government Work",nt"extras":
